pragma solidity ^0.4.24;

import "openzeppelin-solidity/contracts/ownership/Ownable.sol";

import "./../Campaign/ICampaign.sol";


contract ProxyOracleRegistry is Ownable {

  /* Struct storing the fact that an Oracle has registered */
  struct Oracle {
    uint16 index;
    uint8 oracleType;
    bool isOracle;
  }

  /* All oracles currently registered */
  address[] oracles;

  /* Storing the details of a registered oracle */
  mapping(address => Oracle) oracleDetails;

  event OracleRegistered(address _oracleAddress, uint8 _oracleType, uint16 _oracleIndex);
  event OracleDeleted(address _oracleAddress, uint16 _oracleIndex);

  /* Fired each time the reward function is called */
  event RewardRequested(address indexed _rewarded, address indexed _oracleAddress, address indexed _campaignAddress, bytes32 _pob);

  /**
    * @dev Gets the type of the Oracle (the type of campaign it can be an oracle for)
    */
  function getOracleType(
    address _oracleAddress
  )
    public
    view
    returns (uint8)
  {
    require (isOracle(_oracleAddress));
    return (oracleDetails[_oracleAddress].oracleType);
  }

  /**
    * @dev Checks whether an oracle is registered
    */
  function isOracle(
    address _oracleAddress
  )
    public
    view
    returns (bool)
  {
    return oracleDetails[_oracleAddress].isOracle;
  }

  /**
    * @dev Gets the index of a given oracle
    */
  function getIndex(
    address _oracleAddress
  )
    public
    view
    returns (uint16)
  {
    require (isOracle(_oracleAddress));
    return (oracleDetails[_oracleAddress].index);
  }

  /**
    * @dev Removes oracle from registry
    */
  function deleteOracle(
    address _oracleAddress
  )
    public
    onlyOwner
    returns(uint16)
  {
    require (isOracle(_oracleAddress));
    oracleDetails[_oracleAddress].isOracle = false;

    // Defining the index of element to delete and of last element
    uint16 rowToDelete = oracleDetails[_oracleAddress].index;
    address keyToMove = oracles[oracles.length-1];

    // Switching element to delete with the last element in the array
    oracles[rowToDelete] = keyToMove;
    oracleDetails[_oracleAddress].index = rowToDelete;

    // Deletion of last element in index, which
    // otherwise would be present twice in the list
    oracles.length--;

    emit OracleDeleted(_oracleAddress, rowToDelete);

    return rowToDelete;
  }

  /**
    * @dev Adds oracle to registry
    * @param _oracleAddress Address of the oracle
    * @param _oracleType Type of the oracle
    */
  function registerOracle(
    address _oracleAddress,
    uint8 _oracleType
  )
    public
    onlyOwner
    returns (uint16)
  {
    require (!isOracle(_oracleAddress));

    oracleDetails[_oracleAddress].isOracle = true;
    oracleDetails[_oracleAddress].oracleType = _oracleType;
    oracleDetails[_oracleAddress].index = uint16(oracles.push(_oracleAddress)-1);

    uint16 oracleIndex = uint16(oracles.length-1);

    emit OracleRegistered(_oracleAddress, _oracleType, oracleIndex);

    return oracleIndex;
  }

  /**
    * @dev Checks that oracle triggering the reward is registered before forwarding the request to the campaign contract
    * @param _account Address of the rewarded user
    * @param _campaign Address of the rewarding campaign
    * @param _pob Proof-of-Behavior that caused the triggering of the reward
    */
  function triggerReward(
    address _account,
    address _campaign,
    bytes32 _pob
  )
    public
    returns(bool)
  {

    emit RewardRequested(_account, msg.sender, _campaign, _pob);

    // the oracle needs to be whitelisted to trigger
    require(isOracle(msg.sender), "Rewarding should be triggered by a registered oracle");

    ICampaign campaignInterface = ICampaign(_campaign);
    require(getOracleType(msg.sender) == campaignInterface.getCampaignType(), "Types of oracle and campaign do not match");

    campaignInterface.reward(_account, _pob);

    return true;
  }

  function kill()
    public
    onlyOwner
  {
    selfdestruct(owner());
  }
}

